import { Row, Col, Image } from "react-bootstrap";
import products from "products";
import { RouteComponentProps } from "react-router";
import { RouteParams } from "pages/CardProduct/types";
import { CardProductProps } from "pages/CardProduct/types";

const CardProduct = ({ match }: RouteComponentProps<RouteParams>): any => {
	const product = products.filter(
		(prod) => prod._vendorСode === match.params.vendorCode
	);

	product.push({ name: "", image: "" });

	return (
		<>
			<Header />

			{console.log(product)}
			<Row>
				<Col></Col>
			</Row>
		</>
	);
};

export default CardProduct;
